measurements.description:
Eleven well-proportioned Broad Lip flowers and three buds on one 110cm arching inflorescence;
	sepals and petals pale lavender-pink, petals blushed darker lavender centrally;
	lip side lobes broadened and partly fused with base of midlobe, all deep lavender, calli pale yellow and white;
	column white with fuchsia spots, anther cap white; substance fair; texture matte.
